export default class extends React.Component{

    render(){
        return(
           <div className='fondo'>
               <ul>
                    <li>
                        <button href='' onClick={this.Click} ref={this.myRef}>Hombre</button>
                   </li>
                   <li>
                        <button href='' onClick={this.Click} ref={this.myRef}>Mujer</button>
                   </li>
               </ul>
               <style jsx>
                   {`
                        .fondo{
                            box-shadow: 0px 0px 0px 3px;
                            width: 260px;
                            height: 33px;
                            text-align:center;
                        }

                       ul{
                           padding-left: 1px;
                       }

                        li{
                            display: inline-block;
                            margin-top: 5px;
                            margin-bottom: 5px;
                            margin-left: 15px;
                            margin-right: 15px;
                        }

                        a{
                            text-decoration: none;
                        }
                   `}
               </style>
           </div>
        );
    }

    Click = () => {
        myRef = React.createRef();
        alert(myRef)
      }
}
